    "def PlotLinearRegression(x_values, y_values, x_label, y_label, y_min, y_max, title, image_name):\n",
    "    (slope, intercept, rvalue, pvalue, stderr) = st.linregress(x_values, y_values)\n",
    "\n",
    "    # Get regression values (mx+b)\n",
    "    regress_values = x_values * slope + intercept\n",
    "\n",
    "    # Plot our results\n",
    "    fig = plt.figure(figsize=(10, 7))\n",
    "    ax = fig.add_subplot()\n",
    "\n",
    "    ax.scatter(x_values, y_values, edgecolors=\"grey\", marker=\"o\")\n",
    "    plt.plot(x_values, regress_values, \"b-\")\n",
    "\n",
    "    # Formatting\n",
    "    plt.xlabel(x_label)\n",
    "    plt.ylabel(y_label)\n",
    "    ax.set_xlim(0, 10)\n",
    "#     ax.set_ylim(y_min, y_max)\n",
    "    ax.grid(True)\n",
    "    plt.title(title)\n",
    "\n",
    "    # Show the chart\n",
    "    print(f\"The correlation coefficient is: {rvalue}\")\n",
    "    plt.show()\n",
    "\n",
